import { FunctionComponent } from "react";
import styles from "../Content/css/FrmMaster.module.css";
import Sidebar from "../SideBar/Sidebar";

function MenuHamburguer_Click(){

  let xmlContent = '';
  let tableBooks = document.getElementById('books');
  fetch('books.xml').then((response)=> {
      response.text().then((xml)=>{
          xmlContent = xml;
          
          let parser = new DOMParser();
          let xmlDOM = parser.parseFromString(xmlContent, 'application/xml');
          let books = xmlDOM.querySelectorAll('book');

          books.forEach(bookXmlNode => {

              let row = document.createElement('tr');

              //author
              let td = document.createElement('td');
              td.innerText = bookXmlNode.children[0].innerHTML;
              row.appendChild(td);

              //  title
              td = document.createElement('td');
              td.innerText = bookXmlNode.children[1].innerHTML;
              row.appendChild(td);
              
              //price
              td = document.createElement('td');
              td.innerText = '$ ' + bookXmlNode.children[3].innerHTML;
              row.appendChild(td);

              //description
              td = document.createElement('td');
              td.innerText = bookXmlNode.children[5].innerHTML;
              row.appendChild(td);

              tableBooks.children[1].appendChild(row);
              
          });
          
      });
  });    
}


export const Master: FunctionComponent = ({
children
}) => {
  return (
     <div className={styles.frmMasterDiv}>
     <div className={styles.menuDiv}>
       <div className={styles.frameDiv} />
       <div className={styles.frameDiv1} />
       <div className={styles.frameDiv2} />  
     </div>
     <div className={styles.bodyDiv}>
       <div className={styles.pnlTopDiv}>
         <button className={styles.btnHamburguerButton} onClick={MenuHamburguer_Click}/>
       </div>
       <div className={styles.corpoDiv}>
         {children}
       </div>
     </div>
   </div>
  );
};
